Esos nombres se usaban desde antes de que el lol existiera...
El nombre "Zed" se uso como nombre de la canción "Zed's dead baby, Zed's dead" que es de 1994, además de ser la forma en la que los británicos pronuncian la letra "Z"
El nombre "Vladimir" te debe de sonar de algo que no sea lol, no se, quizás del presidente de Rusia, Vladimir Putin, entre otras cosas{{sticker:slayer-pantheon-popcorn}} 
y el nombre "Viktor" se usa en algunos libros o películas, como harry potter, o la película "underworld"{{sticker:slayer-pantheon-thumbs}}
